import React from 'react';
import {
  UserDropDwonBox,
  Text,
  UserItem,
  Linked,
  Line,
} from './User-DropDown.style';
const UserDropDown = () => {
  return (
    <UserDropDwonBox>
      <UserItem>
        <Linked to="/login">Log in</Linked>
        <Linked to="/login">Sign up</Linked>
        <Line />
        <Text>Host your home</Text>
        <Text>Host an experience</Text>
        <Text>Help</Text>
      </UserItem>
    </UserDropDwonBox>
  );
};

export default UserDropDown;
